import React from 'react';
import '../scss/main.scss';

const Skills = () => {
    return (
      <div className="skills">
        <div className="graph"><span></span></div>
        <li className="front-end"><span>React</span></li>
        <li className="front-end"><span>Redux</span></li>
        <li className="back-end"><span>Node.js</span></li>
        <li className="back-end">Express</li>
        <li className="front-end">Java Script</li>
        <li className="back-end">Ruby</li>
        <li className="back-end">Rails</li>
        <li className="back-end">PostgreSQL</li>
        <li className="back-end">MongoDB</li>
        <li className="front-end">HTML/SCSS</li>
        <li className="front-end">UI Design</li>
        <li className="front-end">Photoshop</li>
      </div>
    );
  }

export default Skills
